var code1 = "";
var code2 = "";
var code3 = "";
var code4 = "";
var code5 = "";

var markGrid = new Array(4);

var a = 0;
for (a = 0; a <= 4; a++) {
	markGrid[a] = new Array(4);
}

a = 0;
d = 1;
for (a = 0; a <= 4; a++) {
	for (c = 0; c <= 4; c++) {
		if (((a == 0) && ((a-c) == -2))
			|| ((a == 1) && (((a-c) <= 0) && ((a-c) >= -2)))
			||  (a == 2)
			|| ((a == 3) && (((a-c) >= 0) && ((a-c) <= 2)))
			|| ((a == 4) && ((a-c) == 2))
			) {
				markGrid[a][c] = d;
				d++;
			} else {
				markGrid[a][c] = -1;
				continue;
			}
	}
}

getCode(code1);
getCode(code2);
getCode(code3);
getCode(code4);
getCode(code5);

function getCode(code) {
	var b = 0;
	var i = 2;
	var j = 0;
	
	for (b = 0; b <= (code.length-1); b++) {
		switch(code.charAt(b)) {
			case 'D':
				if ((i+1) <= 4 && markGrid[i+1][j] >= 0) {
					i++;
				}
			break;
			case 'U':
				if ((i-1) >= 0 && markGrid[i-1][j] >= 0) {
					i--;
				}
			break;
			case 'R':
				if ((j+1) <= 4 && markGrid[i][j+1] >= 0) {
					j++;
				}
			break;
			case 'L':
				if ((j-1) >= 0 && markGrid[i][j-1] >= 0) {
					j--;
				}
			break;
		}
	}
	
	console.log('(' + i + ',' + j + ')' + markGrid[i][j]);
}
